    false,nt"url": null,nt"notes": "This narrative report for Blackwater National
    Wildlife Refuge outlines Refuge accomplishments during the 1976 calendar year. The
    report begins with an introduction to the Refuge and information about weather conditions,
    habitat conditions, land acquisition activities, and the system status. Construction,
    maintenance, and wildfires are also described. Habitat management is covered; croplands,
    wetlands, and forests are discussed. The wildlife section of the report discusses
    endangered species, threatened species, migratory birds, mammals, and non-migratory
    birds. Interpretation and recreation activities are outlined; topics include fishing,
    hunting, and law enforcement. Field investigations, cooperative programs, items
    of interest, and safety information are included.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
